import React from "react";
import { Card, Icon, Image } from "semantic-ui-react";

class Search extends React.Component {
  render() {
    return (
    //   <Card.Group centered items={true} itemsPerRow={3}>
        <Card>
          <Image
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQsBVE6FmYUwlhl6eiePXhi_zNuGQ9H1XPMgg&usqp=CAU"
            wrapped
            ui={false}
          />
          <Card.Content>
            <Card.Header>{this.props.searchProp.volumeInfo.title}</Card.Header>
            <Card.Meta>
              <span>{this.props.searchProp.volumeInfo.authors}</span>
            </Card.Meta>
            <Card.Description>
              {this.props.searchProp.volumeInfo.description}
            </Card.Description>
          </Card.Content>
        </Card>
    //   </Card.Group>
    );
  }
}
export default Search;
